    "Password reset email sent. Follow the link in the email to change your password.": "\u0e23\u0e2b\u0e31\u0e2a\u0e23\u0e35\u0e40\u0e0b\u0e47\u0e17\u0e2d\u0e35\u0e40\u0e21\u0e25\u0e4c\u0e2a\u0e48\u0e07\u0e41\u0e25\u0e49\u0e27. \u0e15\u0e32\u0e21\u0e25\u0e34\u0e49\u0e07\u0e04\u0e4c\u0e43\u0e19\u0e2d\u0e35\u0e40\u0e21\u0e25\u0e4c\u0e44\u0e1b\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e40\u0e1b\u0e25\u0e35\u0e48\u0e22\u0e19\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19", 
    "Paste": "\u0e27\u0e32\u0e07", 
    "Paste as text": "\u0e27\u0e32\u0e07\u0e02\u0e49\u0e2d\u0e04\u0e27\u0e32\u0e21", 
    "Paste is now in plain text mode. Contents will now be pasted as plain text until you toggle this option off.": "\u0e01\u0e32\u0e23\u0e27\u0e32\u0e07\u0e2d\u0e22\u0e39\u0e48\u0e43\u0e19\u0e41\u0e1a\u0e1a\u0e15\u0e31\u0e27\u0e2d\u0e31\u0e01\u0e29\u0e23\u0e17\u0e35\u0e48\u0e44\u0e21\u0e48\u0e21\u0e35\u0e23\u0e39\u0e1b\u0e41\u0e1a\u0e1a \u0e40\u0e19\u0e37\u0e49\u0e2d\u0e2b\u0e32\u0e08\u0e30\u0e16\u0e39\u0e01\u0e27\u0e32\u0e07\u0e14\u0e49\u0e27\u0e22\u0e27\u0e34\u0e18\u0e35\u0e19\u0e35\u0e49\u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e04\u0e38\u0e13\u0e08\u0e30\u0e40\u0e2d\u0e32\u0e15\u0e31\u0e27\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e2d\u0e2d\u0e01", 
    "Paste row after": "\u0e43\u0e2a\u0e48\u0e41\u0e16\u0e27\u0e2b\u0e25\u0e31\u0e07\u0e08\u0e32\u0e01\u0e19\u0e35\u0e49", 
    "Paste row before": "\u0e43\u0e2a\u0e48\u0e41\u0e16\u0e27\u0e01\u0e48\u0e2d\u0e19\u0e2b\u0e19\u0e49\u0e32\u0e19\u0e35\u0e49", 
    "Paste your embed code below:": "\u0e27\u0e32\u0e07\u0e23\u0e2b\u0e31\u0e2a\u0e17\u0e35\u0e48\u0e04\u0e38\u0e13\u0e15\u0e49\u0e2d\u0e07\u0e01\u0e32\u0e23\u0e25\u0e07\u0e44\u0e1b:", 
    "Path to Signature Image": "\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e44\u0e1b\u0e22\u0e31\u0e07\u0e20\u0e32\u0e1e\u0e25\u0e32\u0e22\u0e40\u0e0b\u0e47\u0e19", 
    "Pause": "\u0e1e\u0e31\u0e01", 
    "Pending": "\u0e2d\u0e22\u0e39\u0e48\u0e23\u0e30\u0e2b\u0e27\u0e48\u0e32\u0e07\u0e14\u0e33\u0e40\u0e19\u0e34\u0e19\u0e01\u0e32\u0e23", 
    "Photo Captured successfully.": "\u0e08\u0e31\u0e1a\u0e20\u0e32\u0e1e\u0e2a\u0e33\u0e40\u0e23\u0e47\u0e08\u0e25\u0e38\u0e25\u0e48\u0e27\u0e07", 
    "Photo ID": "ID \u0e23\u0e39\u0e1b", 
    "Photo Identification": "\u0e20\u0e32\u0e1e\u0e1b\u0e23\u0e30\u0e08\u0e33\u0e15\u0e31\u0e27", 
    "Photo of %(fullName)s": "\u0e23\u0e39\u0e1b\u0e02\u0e2d\u0e07%(fullName)s", 
    "Photo of %(fullName)s's ID": "\u0e23\u0e39\u0e1b\u0e02\u0e2d\u0e07ID%(fullName)s", 
    "Photo requirements:": "\u0e02\u0e49\u0e2d\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e02\u0e2d\u0e07\u0e23\u0e39\u0e1b:", 
    "Photos don't meet the requirements?": "\u0e20\u0e32\u0e1e\u0e16\u0e48\u0e32\u0e22\u0e44\u0e21\u0e48\u0e15\u0e23\u0e07\u0e01\u0e31\u0e1a\u0e02\u0e49\u0e2d\u0e01\u0e33\u0e2b\u0e19\u0e14?", 
