    "correct": "\u0e16\u0e39\u0e01", 
    "delete chapter": "\u0e25\u0e1a\u0e1a\u0e17", 
    "delete group": "\u0e25\u0e1a\u0e01\u0e25\u0e38\u0e48\u0e21", 
