    "dropped in slider": "\u0e27\u0e32\u0e07\u0e43\u0e19\u0e41\u0e16\u0e1a\u0e40\u0e25\u0e37\u0e48\u0e2d\u0e19", 
    "dropped on target": "\u0e25\u0e32\u0e01\u0e44\u0e1b\u0e1a\u0e19\u0e40\u0e1b\u0e49\u0e32\u0e2b\u0e21\u0e32\u0e22", 
    "e.g. johndoe@example.com, JaneDoe, joeydoe@example.com": "\u0e40\u0e0a\u0e48\u0e19 johndoe@example.com, JaneDoe, joeydoe@example.com", 
    "emphasized text": "\u0e02\u0e49\u0e2d\u0e04\u0e27\u0e32\u0e21\u0e17\u0e35\u0e48\u0e40\u0e19\u0e49\u0e19", 
    "endorsed %(time_ago)s": "\u0e40\u0e2b\u0e47\u0e19\u0e14\u0e49\u0e27\u0e22 %(time_ago)s \u0e17\u0e35\u0e48\u0e1c\u0e48\u0e32\u0e19\u0e21\u0e32", 
    "endorsed %(time_ago)s by %(user)s": "\u0e40\u0e2b\u0e47\u0e19\u0e14\u0e49\u0e27\u0e22 %(time_ago)s \u0e17\u0e35\u0e48\u0e1c\u0e48\u0e32\u0e19\u0e21\u0e32 \u0e42\u0e14\u0e22 %(user)s", 
    "enrolled": "\u0e04\u0e38\u0e13\u0e44\u0e14\u0e49\u0e25\u0e07\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19\u0e41\u0e25\u0e49\u0e27", 
    "enter code here": "\u0e43\u0e2a\u0e48\u0e23\u0e2b\u0e31\u0e2a\u0e17\u0e35\u0e48\u0e19\u0e35\u0e48", 
